import * as React from "react";
import { Text, View, StyleSheet, Image, Pressable } from "react-native";


function Example() {
  return (
    <View>
      <View style={styles.container}>
        <View style={styles.topContainer}>
          <View style={styles.metaContainer}>
            <View>
              <Text style={styles.timings}>Агуулахын бараа бүртгэл</Text>
              <Text style={styles.description}>InventoryN тавтай морил?</Text>
            </View>
          </View>
          <Image
            source={{
              uri: "https://arxspan.com/wp-content/uploads/2018/12/inventory-header-icon-bl.png",
            }}
            style={styles.avatar}
          />
        </View>
      </View>
      <Text
        style={{
          textAlign: "center",
        }}
      >
        Бидний тухай
      </Text>
      <View style={styles.container1}>
        <View style={styles.topContainer}>
          <View style={styles.metaContainer}>
            <View>
              <Text style={styles.timings}>Агуулахын бараа бүртгэл</Text>
              <Text style={styles.description}>Хэрхэн бараа бүртгэх вэ?</Text>
              <Pressable style={styles.button}>
                <Text style={styles.buttonText}>Орох</Text>
              </Pressable>
            </View>
          </View>
        </View>
      </View>
      <Text
        style={{
          textAlign: "center",
        }}
      >
        ...
      </Text>
      <View style={styles.container2}>
        <View style={styles.topContainer}>
          <View style={styles.metaContainer}>
            <View>
              <Text style={styles.timings}>Агуулахын бараа бүртгэл</Text>
              <Text style={styles.description}>Бидэнтэй холбогдох</Text>
              <Pressable style={styles.button}>
                <Text style={styles.buttonText}>Орох</Text>
              </Pressable>
            </View>
          </View>
        </View>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    backgroundColor: "#0891b2",
    paddingVertical: 16,
    paddingHorizontal: 12,
    borderRadius: 10,
    alignSelf: "center",
    width: 375,
    maxWidth: "100%",
  },
  container1: {
    backgroundColor: "#0C4CF7",
    paddingVertical: 15,
    paddingHorizontal: 12,
    borderRadius: 10,
    alignSelf: "center",
    width: 375,
    maxWidth: "100%",
  },
  container2: {
    backgroundColor: "#F9BC19",
    paddingVertical: 15,
    paddingHorizontal: 12,
    borderRadius: 10,
    alignSelf: "center",
    width: 375,
    maxWidth: "100%",
  },
  timings: {
    color: "#fff",
    fontSize: "14px",
  },
  metaContainer: {
    justifyContent: "space-between",
  },
  topContainer: {
    flexDirection: "row",
    justifyContent: "space-between",
  },
  avatar: {
    height: 100,
    width: 100,
    borderRadius: 100,
  },
  description: {
    color: "white",
    marginTop: 5,
    fontSize: 20,
  },
  button: {
    backgroundColor: "#22d3ee",
    alignSelf: "flex-start",
    paddingHorizontal: 12,
    paddingVertical: 4,
    borderRadius: 2,
  },
  buttonText: {
    fontWeight: "bold",
    color: "white",
    textTransform: "uppercase",
    fontSize: 14,
  },
});

export default () => {
  return <Example />;
};
